INSERT INTO `um_about` VALUES ('1', '关于uMenter', '<p>uMentor留学是国内领先的互联网留学解决方案提供者，始终致力于提供更加值得信赖的一站式留学申请服务。品牌运营者拥有多年一线留学资讯媒体经验，同时具备丰富的留学资源、学校资源以及多年的专业操作经验，可以为广大学员提供更加专业和优质的文书代写与修改申请服务。西柚留学拥有800+的导师，遍布北美、欧洲和澳洲，90%以上导师来自世界排名TOP30的学校，可以帮助广大留学生一键式便捷申请英国、美国和澳洲等海外大学。我们通过顶级学府和各行业的精英导师来打破国内外教育信息资源不对称，为家长和同学们提供一个可靠的留学申请资讯服务。西柚留学为每一位申请一站式服务的同学提供优质贴心的服务，不限于前期辅导、背景提升、专业择校、文书策划、面试及套磁、签证协助等，助力实现留学梦。</p>', '<p>Are you interested in flexible earnings, working on interesting projects with an established online team? Are you a Native-English speaker with outstanding experience of competitive applications and compelling personal presentation? Are you client-focused and capable of meeting deadlines consistently?<br/>Please follow this link http://www.umentor.cn for more details about how you can apply to be a member of our Advisor team right now!</p>', '<p>只要您自主申请并成功获得offer或者在海外留学/工作，乐于帮助他人实现留学之梦，您都可以加入我们的顾问团队。uMentor留学目前正在积极开展全国的市场推广活动。届时，将有大量的留学申请者寻求您的帮助。<br/>职位概述：<br/>1，针对您擅长的领域：留学考试/申请过程/海外生活/实习工作等，提供口头咨询和信息分享。<br/>2，自行设定可预约的时间，为留学申请者解答困惑。<br/>咨询回报：<br/>可观的收入：只要够popular，上不封顶。表现优秀者，还可以获得中英文推荐信！<br/>如有疑问，请咨询：hr@umentor.cn</p>', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">uMentor留学认为翻译是文字与文字转换的艺术，是一份令人尊敬的工作，为了保证翻译的质量，鼓励精益求情的态度，所以uMentor留学提供不低于120元/千字的翻译报酬，uMentor留学涵盖广泛的专业领域，肯定有适合你的发挥的天地。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">邀请对象：只要您有优秀的翻译能力，积极、负责的工作态度，您都可以加入我们的团队。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">职位概述</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">1，针对您擅长的专业领域，帮助用户把中文文书翻译成英文或其它语言，再由外籍编辑来润色。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">2，自由的工作时间（接单后在Deadline前完成翻译）。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">工作回报：中译英薪酬: 120－140元/千字（根据翻译难度）</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">表现优秀者，还可以获得中英文推荐信！</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; background-color: rgb(255, 255, 255);\">报名方式：发送简历到hr@umentor.cn</span></p>', '2019', '1559196725', null);
