INSERT INTO `um_apply` VALUES ('1', '/uploads/attachment/20190528/ea526b2b778b5ed582b176416e0973cd.png', '前期咨询和答疑', '<p>初步了解学生的需求和自我定位</p><p>介绍留学服务的内容及理念</p><p>指导填写信息收集表并匹配专业导师</p><p><br/></p>', '1559036257', '1559036681', null);
INSERT INTO `um_apply` VALUES ('2', '/uploads/attachment/20190528/c57deaa6f661509ce9eb31607de5b2d3.png', '留学选校及考试规划', '<p>综合评价学生背景能力及定位的合理性</p><p>导师和学生共同确定学校和专业范围</p><p><br/></p>', '1559036781', '1559036792', null);
INSERT INTO `um_apply` VALUES ('3', '/uploads/attachment/20190528/fec995dbfdcb52a7078d725508396220.png', '标准化考试规划', '<p>合理规划学习及考试时间安排</p><p>分析申请进程，确立留学规划时间表</p><p><br/></p>', '1559036842', '1559036842', null);
INSERT INTO `um_apply` VALUES ('4', '/uploads/attachment/20190528/c5fac2dc2aed7318a05f8ce904b18556.png', '背景提升计划', '<p>挖掘及放大申请人的优势</p><p>导师指定背景提升计划</p><p>督促学生积极开展背景提升方案</p><p><br/></p>', '1559036886', '1559036886', null);
INSERT INTO `um_apply` VALUES ('5', '/uploads/attachment/20190528/d891ea409596881c8f63269f0bac1c57.png', '文书策划和制作', '<p>导师根据收集的文字资料和综合背景设计文书方案</p><p>由西柚导师按所设计文书结构与闪光点进行文书写作</p><p>专业文书导师多轮互动修改直至完成一整套文书材料</p><p><br/></p>', '1559036926', '1559036926', null);
INSERT INTO `um_apply` VALUES ('6', '/uploads/attachment/20190528/9011000ffe51727c3fffdbfc037ce2a1.png', '协助网申', '<p>协助学生进行在线申请，并指导准备必须资料</p><p>提供成绩单翻译、资金证明翻译等服务</p><p>跟进申请专业的申请进度，确保申请万无一失</p><p><br/></p>', '1559036961', '1559036961', null);
