INSERT INTO `um_evaluate` VALUES ('2', '1', '1', '我也是留言', '计算机科学与技术', '论文指导', '引用名篇经典，是习近平讲话的一大特色，其用典精妙广博，意境深远，引人入胜。“国家之魂，文以化之，文以铸之”，“学习大国”梳理今年习近平在重要场合引用的部分诗词古语，带您一起学习经典。', '2', '1559011696', null);
INSERT INTO `um_evaluate` VALUES ('3', '1', '1', '亲仁善邻、协和万邦是中华文明一贯的处世之道，惠民利民、安民富民是中华文明鲜明的价值导向，革故鼎新、与时俱进是中华文明永恒的精神气质，道法自然、天人合一是中华文明内在的生存理念。', '软件工程', '项目指导', '“亲仁善邻”“协和万邦”引申到今天，就是与邻邦之间和睦相处、守望相助，协调不同国家之间的关系，让各个国家都能够相互尊重、相互合作、共同发展。如今各国相互依存度持续增加，只有尊重、包容不同文明的存在，坚持互利合作，纳百家优长，集八方精义，才能与世界各国一道，实现共同发展和共同繁荣。正如习近平所说，“未来之中国，必将以更加开放的姿态拥抱世界、以更有活力的文明成就贡献世界。”这也正是“亲仁善邻”“协和万邦”表达的寓意。', '3', '1559011603', null);
