INSERT INTO `um_experience` VALUES ('1', '/uploads/attachment/20190603/e091622ef0f5bd8ee1625699a65062f9.jpg', '/uploads/attachment/20190603/d2634d90fe4598c9df37f2fc0ac7e8c1.png', '任红', '美国8大常春藤学校校徽背后的故事', '<p>近年来留学热潮持续增长，家长们都希望能把孩子送进全球顶级名校。提到美国的顶尖名校，大家都会个想到常春藤盟校(Ivy League)。</p>', '1559543869', '1559544388', null);
