INSERT INTO `um_news` VALUES ('1', '各国海关奇葩规定，小心踩雷', '留学文书服务', null, '1', '/uploads/attachment/20190525/118dcb3beedc909ca1384576e5dc577f.jpg', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">很多国家都有明确规定，其海关及边境保卫人员、移民海关执法局探员等被国家法律赋予边境搜查权力的工作人员，都有权对任何入境旅客的任何电子设备中所包含的任何内容进行检查。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">所以，不论你将要去哪里留学，如果你的电子设备里有违规图片或不当聊天内容，那你都要小心了哦。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">下面说说这些奇葩的海关遣返规定，之后有出国计划的小伙伴们避免踩雷啦！</span><br/><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">01太污的表情包</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">2017年，一名中国留学生在墨尔本机场被要求抽查手机内容，结果海关人员在其微信里发现涉嫌违规的视频和表情包，该同学随即被遣返。</span><br/><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">02不恰当的聊天记录</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">2016年，中国女留学生S因为在微信中向朋友透露“我不喜欢这个学校，只是临时挂一下身份”，在入境时恰好被美国海关逮到，当场被遣返回国。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">还有一名同学曾因Final考的不理想，微信和同学说了句＂我好烦躁＂，结果在被检查手机的时候，被机场的翻译理解为＂I am very worried＂。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">结果检查人员追问了她2个小时，一定要让她说出＂她到底担忧什么＂。</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><img src=\"/ueditor/php/upload/image/20190525/1558748837.jpg\" title=\"1558748837.jpg\" alt=\"de40.jpg\"/></span></p><p><br/></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">而除了电子设备之外，还有很多可能你不觉得有问题的行为，其实也是不被国外的海关人员放行的，甚至会踩雷。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-weight: 700;\">美国</span><br/>携带婴幼儿用品易让人起疑心。</p><p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><br/></span><br/></p>', '1558748883', '1559283122', null);
INSERT INTO `um_news` VALUES ('2', '福布斯公布美国最具价值大学排名', 'offer', null, '1', '/uploads/attachment/20190525/d8b07e50f8b63e5944428022a073483a.jpg', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">美国大学向来是以费用昂贵著称，近几年暴增严重，在5月1号大学签约日——大多数学生接受录取的截止日期前，福布斯公布了2019年最具价值的美国大学，没想到，藤校一败涂地，UC系成绩不俗，倒是有点出乎意料……</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">美国学生中平均每个借贷人负债28,650美元，累计1.5万亿美元。面对如此巨大的经济压力，为了更好地服务学生，为了让更多的家庭在这次重大投资中获得良好的回报，福布斯在前天公布了2019年最具价值的美国大学排名。参与排名的645所学校均为四年制学位的公立和私立大学，不包括私立盈利性学校。</span></p><p><br/></p>', '1558749786', '1559283076', null);
INSERT INTO `um_news` VALUES ('3', '被放waitlist，如何主动争取offer', '留学文书服务', null, '1', '/uploads/attachment/20190525/1aab29a708fda97891af916e4f3a1fd3.jpg', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">每年申请季都有一些学生被某些学校放到waitlist里边，有的学校叫waiting list，即等候名单里边，简称WL，那什么是WL？谁会被放到WL里？收到WL通知后，该如何主动出击，四两拨千斤，争取“转正”拿到offer呢？</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">今天我和大家来详细分析一下。</span></p><p><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">什么是waitlist？</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">提到这个waitlist，首先我想给大家解释一个名词enrollment rate，即报到率。报到率即被学校发放offer的学生中，接受offer并去该校就读的比例。因为每个学生一般会同时申请6-20所学校，最后一般会同时被几个学校录取，可每个学生只能选择一所去就读，那剩下的offer，就只能decline掉了。因此，学校所有给发放offer的学生，不会每个学生都接受该offer并enroll，总会有一些收到offer的学生选择不去该学校就读，所以就有了报到率这个词。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">就连大名鼎鼎的哈佛大学，报到率全美最高，也才只有80%，也就是说每年会有20%收到offer的学生decline掉哈佛的offer。还有非常出名的芝加哥大学，报到率只有60%，会有40%被录取的学生，不接受芝加哥的offer。考虑到报到率这个问题，每年学校对发放offer的数量都有一个预估，比如哈佛大学，如果预计招生160名学生，一般会给200名申请者发offer。但如果在规定的接受录取日期后发现，decline offer的学生数量超过了预期，160名学生招不满了，那么他们就会从waitlist里边来择优录取。</span><br/><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">什么样的人会在waitlist里呢？</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">一般来说，在评审环节，研究生院和系里一致通过的综合素质非常优秀的申请者， 学校会直接发放offer，如果认为学生硬件软件一般，没有过人之处，那么会直接拒掉该申请者。而对于一些整体条件都不错，已经达到了可以录取的标准，但没有优秀到直接给发offer的程度，这样的申请者，学校不舍得直接拒掉，就会给他们放到waitlist里。当然还有一些申请者，学校认为他们Over Qualified了，即便给予offer他们也不能接受，这种情况下，学校也可能给一个WL。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">一般来说，收到WL后，学校都会让你确认一下是否愿意被放到waitlist里边，那么明确表示愿意被放到waitlist里边的申请者，就构成了WL的pool。 而且一般waitlist也会有排名的，综合能力优秀的学生会被优先考虑，在WL的排名也会更高，被录取的几率也相应更大一些。 这样，如果第一批给发放offer的人declineoffer的人数超过了预期，学校就会从waitlist里边来择优发放offer。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">了解了这个情况，大家应该明白，被放到waitlist的学生，一定不要觉得自己希望渺茫了，收到waitlist，至少说明学校认为你还是很不错的，也是学校会考虑录取的对象，你还是完全有机会转正的！</span><br/><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">收到Waitlist之后该怎么做？</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">如果被waitlist的学校是你主申甚至保底的学校，你已经拿到了更理想的录取，这个时候，如果你想多拿到一个offer，就可以选择愿意被放到waitlist里边，也不用刻意发邮件争取，随缘就好。如果自己根本不care这个offer，也不想花任何额外时间在这个学校上，那就直接ignore这个WL邮件就好了。</span></p>', '1558749863', '1558749863', null);
INSERT INTO `um_news` VALUES ('4', '澳洲商科专业学校解析', '留学文书服务', null, '1', '/uploads/attachment/20190525/0eb7d1ca8fcca1eae7f572aaec2c5d36.jpg', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">申请明年入学的留学森大军即将来袭~</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">新的一波选校选专业的纠结又来了~</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">一问留学选了什么专业，不管是去哪个国家，商科总是大家绕不开的话题~</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">商科到底学什么？商科哪家强？八大商学院怎么样？</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">好吧，小长假之前小编再次给大家科普一波</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">澳洲商科选校指南，也为准留学生们答疑解惑~</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-weight: 700;\">商科到底学什么？</span><br/>商科是一个较为宽泛的概念，涵盖了会计、经济、金融、市场营销、国际贸易等。<br/>目前留学生比较热衷的专业有：</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">会计 accounting<br/>应用经济学 Applied Economics<br/>商业信息系统 Business Information Systems<br/>金融 finance<br/>精算 Actuarial Studies<br/>应用金融 Applied Finance<br/>经济学 Economics<br/>统计学 Statistics<br/>货币银行学 Money and Banking<br/>这些专业对申请人的数学能力有一定的要求，理论性较强，属于知识密集型的课程。<br/>当然，商科中也有一些与数学关联性较少、实践性比较强的专业，如：<br/>广告 Advertising<br/>电子商务 EBusiness<br/>市场营销 Marketing<br/>会展管理 Event Management<br/>酒店管理 Hotel Management<br/>国际商务 International Business<br/>国际旅游管理 International Business<br/>物流与供应链管理 Logistics and Supply Chain Management<br/>物业管理 Property Service Management<br/>房地产开发 Real Estate and Development<br/>体育管理 Sport Management<br/>旅游管理 Tourism Management<br/>建筑管理 Building and Construction Management<br/>人力资源管理 Human Resource Management<br/>国际贸易 International Trade<br/>零售服务管理 Retail Service Management<br/>餐饮管理 Hospitality Management 等。<br/>商科的专业方向其实是非常宽泛的，准留学生们在选择专业的时候，可以主要考虑是以移民为目的，还是以兴趣深造为主哦。<br/>专业排名<br/>不管是这会计，精算，商科，管理，MBA，大家最最关心的都是：排名...<br/>那么问题来了，澳洲商科哪家强？<br/>2月份QS刚刚发布了最具体专业排名，分了5大领域，48个专业。</p><p><br/></p>', '1558750372', '1558750372', null);
INSERT INTO `um_news` VALUES ('5', 'THE首发世界大学影响力排名！曼大成功逆袭！KCL位居第五', 'offer', null, '1', '/uploads/attachment/20190525/0fb7aa46b36b25c1384dedd632c6c1c6.jpg', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">泰晤士高等教育 (Times Higher Education) 近日在与韩国高等科学技术学院（KAIST）的“创新与影响力峰会”上发布了首次“世界大学影响力排名”的结果。</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">该项排名涵盖了76个国家和地区的462所高等院校，日本大学参与数量最多，共有41所大学入榜，而美国有31所，俄罗斯有30所，英国有26所，中国有18所。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">这是一个开创性的新排名，根据联合国可持续发展目标( UN Sustainable Development Goals 简称SDGs) 评估大学对于社会产生的影响力。</span><br/><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">评选指标</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 3 - 健康与幸福</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 4 - 素质教育</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 5 - 性别平等</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 8 - 良好工作和经济增长</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 9 - 工业、创新和基础设施</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 10 - 减少不平等</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 11 - 可持续城市和社区</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 12 - 尽责消费和生产</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 13 - 气候行动</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 16 - 和平、正义和强大机构</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">SDG 17 - 为实现目标建立的合作关系</span></span></p>', '1558750498', '1558750498', null);
INSERT INTO `um_news` VALUES ('6', '2019海归就业报告，三成海归月薪一万！这不能代表一切！', '留学文书服务', null, '1', '/uploads/attachment/20190525/f3e14fc6f450af61f48808f22c08d351.jpg', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">4月21日，在线职业教育公司UniCareer发布《2019海归就业力调查报告》，从各方面分析了海归人才求职的现状与趋势。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">4月23日，腾讯理财通、腾讯金融科技智库、腾讯网企鹅智库发布的《2019国人工资报告》显示居民工资理财行为与变迁。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">这俩报告，小编都看了一下，咱谁也别说谁了，总之一句话：你月薪过万了吗？</span></p><p><span style=\"box-sizing: border-box; font-weight: 700; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">月薪过万城市</span><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">全国月薪过万人数占比城市排名中，前三名依次为上海、北京、深圳，而第四、五名被南京和杭州两座城市占据，广州落后于南京、杭州，排名第六。</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">相对高收入人群，上海、北京、深圳、广州、杭州五座城市整体受访者月薪主要集中在5000至8000元区间，该区间人数占该城受访者总数比例分别为28.59%、24.32%、29.57%、29%以及33.68%；而南京受访者中月薪在3000至5000元人数居多，占该城受访者总数比例为28.38%。</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-weight: 700;\">工资水平最高行业</span><br/>经济转型，互联网行业仍旧发展迅速，工资水平在全国行业排名中位列。互联网行业以外，房地产与金融市场的火热也体现在从业人员的收入上，房地产与金融行业分别占据全国工资水平第二、三名。</p>', '1558750609', '1558750609', null);
