INSERT INTO `um_teacher` VALUES ('1', '李学长', '/uploads/attachment/20190517/fbb3bc6f1d180443307306e4e2ed9549.png', '38', '9', '15', '20', '39', '2002', '10.0', '单项文书、全套文书、留学咨询、翻译等', '金融、经济学、教育学', '<p><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">我既不想像少年时代那样遵循着既定的轨道，也想要担起对未来沉稳的期许。四年的清华园我完成着各式各样的愿望，做学生会的副主席，泡在国贸做没黑没夜地实习，去海外参加国际商事仲裁模拟法庭比赛。在我做完了英国高伟绅律师事务所和美国凯易国际律师事务所的实习以后，作为那年所有外资律所的香港办公室在大陆招的唯一一名本科生，我拿到了美国苏利文克伦威尔律师事务所香港办公室的全职工作邀请，在中环开启了和一线外资投行客户一起为一个个公司的上市、并购、发债通宵达旦的日子。如今我在美国宾夕法尼亚大学完成着我的法律硕士LLM学位，为未来工作做更充足的准备。</span><br/><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">我想，是十八岁那年对外面的世界所有的好奇、勇敢和不服输，指引着我在北京、香港、美国探寻着不一样的人生。</span><br/><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">我对美国、英国、香港的法学硕士（LLM）和法学博士（JD）申请有很好的了解，同时对于法学院学生在内地、香港、美国的高端内资、外资律师事务所的实习和求职也有着详尽的亲身体会。</span><br/><br/><span style=\"color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">在我一路走来获得了无数人的帮助之后，如果我也有能力去帮助更多的人完成他们各自的期许和对未来的探寻，我将荣幸之至。</span></p>', '<p class=\"p1\" style=\"box-sizing: border-box; margin-top: 30px; margin-bottom: 0px; padding: 0px; color: rgb(237, 114, 24); font-weight: bold; font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">综合申请咨询</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">适用专业：申请计划，选校建议，套瓷，网申小问题，求职，未来职业发展等各类咨询（申请材料工程，化学工程，环境工程，等材料相关专业）<br/>说明：在约定好的时间，通过语音交流，回答你任何和申请相关的问题咨询，提供详细的建议。根据你的背景，提供选校建议（冲刺，保底校推荐）。完整的申请计划，套瓷经验分享，网申页面各类问题解答。认真负责，在约定好的时间内给你最高质量的回答，是我对你的承诺。北美全职工作和求学经历让我对材料科学与工程这个行业有了更深的了解，能为你的申请提供行业前沿的信息，提升申请的质量。</p><p class=\"p1\" style=\"box-sizing: border-box; margin-top: 30px; margin-bottom: 0px; padding: 0px; color: rgb(237, 114, 24); font-weight: bold; font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">求职辅导</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">适用服务：求职简历，Cover Letter，模拟面试，求职技巧<br/>说明：目前在美国Microchip Technology全职工程师，Stanford材料科学工程硕士，。熟悉北美材料科学工程求职以及找实习技巧和方法。通过和你语音沟通，交流了解你的背景情况后，我会对你的求职简历，Cover Letter，以及求职方法和规划提出建议以及文书修改意见。我也熟悉CPT/OPT/H1B等证件的申请和使用。</p><p class=\"p1\" style=\"box-sizing: border-box; margin-top: 30px; margin-bottom: 0px; padding: 0px; color: rgb(237, 114, 24); font-weight: bold; font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">留学申请前期咨询</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 思源黑体, &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Microsoft YaHei&quot;, 微软雅黑, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">说明：如果你现在大一大二或者你是学生家长，想要了解材料科学工程北美研究生申请，想要了解背景提升建议，我可以通过语音/视频交流给你提供意见。</p><p><br/></p>', '1558083339', '1559267193', null);
